import React, { useState } from "react";
import { TreeSelect, Input } from "antd";
import { FolderFilled } from "@ant-design/icons";
const { TreeNode } = TreeSelect;
const { Search } = Input;


const Model = () => {
  const [value, setValue] = useState();
  const onChange = (value) => {
    setValue(value);
  };

  const treeData = [
    {
      title: "asda",
      key: "0-0",
      children: [
        {
          title: "leaf 0-0",
          key: "0-0-0",
          isLeaf: true
        },
        {
          title: "leaf 0-1",
          key: "0-0-1",
          isLeaf: true
        }
      ]
    },
    {
      title: "parent 1",
      key: "0-1",
      children: [
        {
          title: "leaf 1-0",
          key: "0-1-0",
          isLeaf: true
        },
        {
          title: "leaf 1-1",
          key: "0-1-1",
          isLeaf: true
        }
      ]
    }
  ];

  return (
    <div style={{ width: "400px" }}>
      <Search

        placeholder="Search"
        onChange={onChange}

      />
      <TreeSelect
      showIcon
      showSearch
      style={{ marginBottom: 8, width: '100%' }}
      dropdownStyle={{ maxHeight: 400, overflow: 'auto' }}
      placeholder="Please select"
      >
        <TreeNode
          key={1}
          icon={<FolderFilled />}
          title={
            <Input placeholder="Enter new folder name" />
          }
        >
          <TreeNode
            key={2}
            title={
              <div>
                <span>s</span>
                <span>Another Column</span>
                <button>Click here</button>
              </div>
            }
          />
        </TreeNode>
      </TreeSelect>
    </div>
  );
};

export default Model;
